Ας υποθέσουμε ότι -σκεφτείτε, σχεδιάστε και ράψτε πολλά όμορφα κοστούμια, όπως τα φορέματα περιόδου της Mary Todd στην Abe Lincoln στο Ιλλινόις και τις τουαλέτες στο A Christmas Carol. Μπορούμε να συμπεράνουμε ότι "Τα κοστούμια κατασκευάστηκαν εξ ολοκλήρου σε ένα εργοστάσιο."; Ναι, όχι, ή ίσως;
['Οχι', 'no', 'false']

Ας υποθέσουμε ότι Αυτή η εικασία βασίζεται, τουλάχιστον εν μέρει, στην ηγεσία του Thumairy για μια εξτρεμιστική παράταξη στο τζαμί. Μπορούμε να συμπεράνουμε ότι "Αυτές οι ομάδες αποτελούσαν περισσότερο από το ήμισυ των μελών του τζαμιού."; Ναι, όχι, ή ίσως;
['Μπορεί']

Ας υποθέσουμε ότι Αυτά μπορεί να περιλαμβάνουν απρόβλεπτες ευκαιρίες για την ενίσχυση της μάθησης των σπουδαστών και των διδασκόντων, προσκαλώντας ειδικούς επισκέπτες και μελετητές στην πανεπιστημιούπολη όταν βρίσκονται στην πολιτεία. Μπορούμε να συμπεράνουμε ότι "Οι μαθητές μπορούν να επωφεληθούν από επισκέψεις στις εστίες."; Ναι, όχι, ή ίσως;
['Ναί', 'yes', 'true']

Ας υποθέσουμε ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Μπορούμε να συμπεράνουμε ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
